(5, 1, '2018-12-11 13:29:42', '2018-12-11 12:29:42', '<p>This is the WPForms preview page. All your form previews will be handled on this page.</p><p>The page is set to private, so it is not publicly accessible. Please do not delete this page :) .</p>', 'WPForms Preview', '', 'private', 'closed', 'closed', '', 'wpforms-preview', '', '', '2018-12-11 13:29:42', '2018-12-11 12:29:42', '', 0, 'http://localhost/MESPROJETS/wordpress/wpforms-preview/', 0, 'page', '', 0),
